INSERT INTO `choices` (`id`, `title`, `function`, `follow_up_question_id`, `question_id`, `explanation`, `uniqid`, `created_at`, `updated_at`) VALUES
(55, 'Front of the car (engine)', 'Explanation', NULL, 29, 'In our experience, most of the time this problem happens because:\r\n\r\nOil is burning due to a fluid leak (you will notice smoke coming out)\r\nCoolant is leaking on the hot engine components (you will notice steam, not smoke)', NULL, '2022-02-09 13:49:39', '2022-02-09 13:49:39'),
(54, 'Within the last month', 'Explanation', NULL, 28, 'In our experience, this problem happens because:\r\n\r\nBrake pads were not installed properly\r\nPoor quality of pads or rotors were used', NULL, '2022-02-09 13:48:24', '2022-02-09 13:48:24'),
(53, 'Not recently or I donâ€™t know', 'Explanation', NULL, 28, 'In our experience, 99% of the time this problem happens because:\r\n\r\nBrake pads and rotors are worn out\r\nPoor quality of pads or rotors\r\nIt is also possible that:\r\n\r\nSuspension component is worn out and it is contributing to the noise', NULL, '2022-02-09 13:47:56', '2022-02-09 13:47:56'),
(51, 'No, this happens when I drive at speeds above 30kms', 'Explanation', NULL, 27, 'In our experience, most of the time this problem happens because:\r\n\r\nTires are separated (you need new tires)\r\nTires are out of balance\r\nWheels are bent\r\nSuspension component is worn out', NULL, '2022-02-09 13:43:50', '2022-02-09 13:43:50'),
(50, 'No, this happens when I drive slow (0-30 km/h)', 'Explanation', NULL, 27, 'In our experience, most of the time this problem happens because:\r\n\r\nEngine needs a tune-up\r\nEngine mounts are broken\r\nDriveshaft is damaged\r\nTires are out of balance\r\nHarmonic balancer is damaged or broken', NULL, '2022-02-09 13:42:36', '2022-02-09 13:42:36'),
(47, 'Engine Compartment', 'Follow up', '25', 25, NULL, NULL, '2022-02-08 09:10:09', '2022-02-08 09:10:09'),
(48, 'Yes, this only happens when I apply brakes', 'Explanation', NULL, 27, 'In our experience,90% of the time this problem happens because:\r\n\r\nFront Brake rotors are warped\r\nIt is also possible that:\r\n\r\nSuspension component is worn or loose\r\nWe Recommend\r\n\r\nBrake Pads Replacement\r\nBrake Rotor/Disc Replacement', NULL, '2022-02-09 13:40:27', '2022-02-09 13:40:27'),
(46, 'BLUE', 'Explanation', NULL, 26, 'The coolant in your car is leaking. Coolant keeps the engine cool and prevents it from overheating. We recommend that you do not drive the car with low coolant. In our experience, this problem is happening because the Heater Core is leaking. We currently do not offer heater core replacements on most cars.', NULL, '2022-02-08 09:09:31', '2022-02-08 09:09:31'),
(45, 'ORANGE', 'Explanation', NULL, 26, 'The coolant in your car is leaking. Coolant keeps the engine cool and prevents it from overheating. We recommend that you do not drive the car with low coolant. In our experience, this problem is happening because the Heater Core is leaking. We currently do not offer heater core replacements on most cars.', NULL, '2022-02-08 09:09:12', '2022-02-08 09:09:12'),
(44, 'GREEN', 'Explanation', NULL, 26, 'The coolant in your car is leaking. Coolant keeps the engine cool and prevents it from overheating. We recommend that you do not drive the car with low coolant. In our experience, this problem is happening because the Heater Core is leaking. We currently do not offer heater core replacements on most cars.', NULL, '2022-02-08 09:08:44', '2022-02-08 09:08:44'),
(42, 'Inside the car', 'Follow up', '26', 25, NULL, NULL, '2022-02-08 09:07:33', '2022-02-08 09:07:33'),
(43, 'COLORLESS', 'Explanation', NULL, 26, 'In our experience, most of the time this problem happens because:\r\n\r\nWindshield seal is leaking\r\nSunroof seal is leaking (if equipped)\r\nEvaporator water leaking from a clogged drain', NULL, '2022-02-08 09:08:15', '2022-02-08 09:08:15'),
(41, 'Check Engine Light is on (Inspection)', 'Explanation', NULL, 24, 'The check engine light comes on when the engine management system has detected faults in the engine or transmission. The problem can be as simple as a loose gas cap or as complex as internal engine damage.', NULL, '2022-02-08 08:36:37', '2022-02-08 08:36:37'),
(40, 'Regular metal key', 'Explanation', NULL, 22, 'In our experience, 99% of the time this problem happens because:\r\n\r\nSteering wheel is locked\r\nCar is not in park\r\nIgnition lock is worn out\r\nWhat You Should Do\r\n\r\nIgnition Lock Assembly\r\n\r\nWe recommend that you take the car to your nearest Autochek Workshop.', NULL, '2022-02-08 08:29:57', '2022-02-08 08:29:57'),
(36, 'No, i do not hear the engine cranking', 'Follow up', '23', 21, NULL, NULL, '2022-02-08 08:27:08', '2022-02-08 08:27:08'),
(35, 'Yes i hear the engine cranking', 'Explanation', NULL, 21, 'In our experience, it is unlikely that the battery is dead. Your car may have a problem with the fuel or ignition system, or there is a mechanical damage (e.g. broken timing belt).\r\n\r\nWe Recommend\r\n\r\nCar is not starting (Inspection)', NULL, '2022-02-08 08:23:49', '2022-02-08 08:23:49'),
(37, 'Yes, I see the indicator lights on', 'Explanation', NULL, 23, 'In our experience, this could be an issue with the starter motor or any of the other components in the starting system circuit.\r\n\r\nPlease Note:\r\nIf you see a flashing key sign on your instrument cluster or dashboard after the ignition is turned on, then you have an issue with the anti-theft or immobilizer system in your vehicle.', NULL, '2022-02-08 08:27:50', '2022-02-08 08:27:50'),
(38, 'No, I donâ€™t see any indicator light', 'Explanation', NULL, 23, 'In our experience, it is an indicator that the battery is discharged. It is also possible you have a defective battery or component in the charging system. This problem could also indicate a deeper electrical problem which would require diagnosis', NULL, '2022-02-08 08:28:21', '2022-02-08 08:28:21'),
(31, 'No, the key does not turn', 'Follow up', '22', 20, NULL, NULL, '2022-02-08 08:17:25', '2022-02-08 08:17:25'),
(39, 'Key FOB (Black device that does not look like a conventional key)', 'Explanation', NULL, 22, 'If the key does not turn, you may have a problem with the ignition system. We currently do not offer ignition related services for cars that have Key Fobs.\r\n\r\nWhat You Should Do\r\n\r\nWe recommend that you take the car to your nearest Autochek Workshop.', NULL, '2022-02-08 08:29:26', '2022-02-08 08:29:26'),
(30, 'Yes, I am able to turn the key', 'Follow up', '21', 20, NULL, NULL, '2022-02-08 08:16:15', '2022-02-08 08:16:15'),
(56, 'White or Blue smoke', 'Explanation', NULL, 30, NULL, NULL, '2022-02-09 13:50:52', '2022-02-09 13:50:52'),
(57, 'Grey or Black smoke', 'Explanation', NULL, 30, 'In our experience, most of the time this problem happens when the car has a problem with the fuel system (too much raw fuel is entering the system).\r\n\r\nThe common reasons are:\r\n\r\nFluid pressure it too high\r\nEngine sensor has failed\r\nFuel management issue', NULL, '2022-02-09 13:51:27', '2022-02-09 13:51:27'),
(58, 'All the time', 'Explanation', NULL, 31, NULL, NULL, '2022-02-09 13:52:49', '2022-02-09 13:52:49'),
(59, 'On very hot days', 'Explanation', NULL, 31, NULL, NULL, '2022-02-09 13:53:06', '2022-02-09 13:53:06'),
(60, 'When I drive uphill', 'Explanation', NULL, 31, NULL, NULL, '2022-02-09 13:53:26', '2022-02-09 13:53:26'),
(61, 'Yes, all the windows are not moving', 'Explanation', NULL, 32, NULL, NULL, '2022-02-09 13:55:40', '2022-02-09 13:55:40'),
(62, 'No, only some of the windows', 'Follow up', '33', 32, NULL, NULL, '2022-02-09 13:59:43', '2022-02-09 13:59:43'),
(63, 'Yes I hear a noise', 'Explanation', NULL, 33, NULL, NULL, '2022-02-09 14:00:20', '2022-02-09 14:00:20'),
(64, 'No, I don\'t hear a noise', 'Explanation', NULL, 33, NULL, NULL, '2022-02-09 14:00:37', '2022-02-09 14:00:37'),
(65, 'Heater core is not working at all', 'Explanation', NULL, 34, NULL, NULL, '2022-02-09 14:02:01', '2022-02-09 14:02:01'),
(66, 'Not getting enough heat', 'Explanation', NULL, 34, NULL, NULL, '2022-02-09 14:02:19', '2022-02-09 14:02:19'),
(67, 'AC is not working at all', 'Explanation', NULL, 34, NULL, NULL, '2022-02-09 14:02:33', '2022-02-09 14:02:33'),
(68, 'Itâ€™s not getting cold enough', 'Explanation', NULL, 34, NULL, NULL, '2022-02-09 14:02:46', '2022-02-09 14:02:46'),
(69, 'Fan speeds are not working', 'Explanation', NULL, 34, NULL, NULL, '2022-02-09 14:03:01', '2022-02-09 14:03:01'),
(70, 'Air is not coming out of the right place', 'Explanation', NULL, 34, NULL, NULL, '2022-02-09 14:03:13', '2022-02-09 14:03:13'),
