INSERT INTO `partners` (`id`, `name`, `url`, `description`, `logo`, `created_at`, `updated_at`) VALUES
(5, 'Honda kenya', 'https://www.hondanrb.com', 'Honda is an unique company, which pursues the passion for speed by entering world top Motorsport racing Formula 1 and Moto GP, pure technology realized by astonishing products such as Honda Jet and ASIMO, the humanoid robotics which you can have a view at the wall display at the show. HONDA is a company built on dreams. And these dreams inspire us to create innovative products that enhance human mobility and benefit society. We see \"The Power of Dreams\" as a way of thinking that guides us and inspires us to move forward. The strength of our company comes from this philosophyâ€”based on the visionary principles of our founder, Soichiro Honda.', '/tmp/phpgqgWbY', '2021-09-15 11:54:06', '2021-09-15 11:54:06'),
(6, 'Subaru WrX', 'https://www.subaru.com/vehicles/wrx/index.html', 'https://www.subaru.com/vehicles/wrx/index.html', '/tmp/phpBEuEdn', '2021-09-15 11:56:16', '2021-09-15 11:56:16'),
(7, 'Isuzu', 'https://www.isuzu.co.ke', 'ISUZU EAST AFRICA Isuzu East Africa (Isuzu EA) is driven by a strong desire to provide transport solutions to our customers\' dynamic needs as demonstrated through our transformation into a \"Trusted Logistics Partner\" for our customers. Isuzu EA has been the leading local vehicle assembler in Kenya for the last nine years in a row with over 95% of sales in the light and heavy commercial vehicles segment. In 2020 the company closed the year with a historic 45.4% market share of new vehicles sold in the country. This success has been driven by the outstanding support of customers and business partners who continue to demonstrate confidence in Isuzuâ€™s enduring legacy.', '/tmp/phpTcLK6D', '2021-09-15 12:02:01', '2021-09-15 12:02:01'),
