INSERT INTO `services` (`id`, `name`, `description`, `price`, `slug`, `image`, `created_at`, `updated_at`) VALUES
(30, 'Car Brake Repair & Clutch Service', '<p class=\"MsoNormal\"><strong style=\"mso-bidi-font-weight: normal;\">Service detail</strong></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal; text-align: left;\">The brakes and clutch of any vehicle is the most important safety equipment. As such driving with worn-out brakes is a major safety risk. Suki spares aims to help solve this need and ensure that your safety is priority by offering extensive brake and clutch repair service.</p>', 12000, NULL, '/tmp/php0wke8L', '2022-01-25 13:23:18', '2022-01-25 13:23:18'),
(31, 'Car Denting & Painting Service', '<p class=\"MsoNormal\"><strong style=\"mso-bidi-font-weight: normal;\">Service detail</strong></p>\r\n<p class=\"MsoNormal\">Suki spares workshops are equipped with state of the art denting and painting equipment to help your car retain the look and shine of a brand new car. We use premium grade paints and primer to deliver the color of your choice with the shine and sheen of a brand new car. Along with denting and painting service, our workshops offer upgrade and modification services for your car</p>', 12000, NULL, '/tmp/phpeaYB6L', '2022-01-25 13:37:03', '2022-01-25 13:37:03'),
(32, 'Car Cleaning & Detailing Servicesss', '<p class=\"MsoNormal\" style=\"line-height: normal;\">Vehicular hygiene is as important as the mechanical health of your car. Thorough cleaning of the interior and exterior delivers optimal performance of your car.</p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\">Dirt and grime can build up under a vehicle over time from the road and they are not good for the undercarriage of your vehicle.The vehicle undercarriage has a drain hole which can get clogged and cause the vehicle to malfunction.</p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\">Rust leads to a faster deterioration of the vehicle condition, and severely affects the chassis of the car. If dirt and other particles accumulated around the engine find a way into the engine this could lead to engine seizure and would require an overhaul.</p>', 2147483647, NULL, 'C:\\xampp\\tmp\\php70C7.tmp', '2022-01-25 13:38:44', '2022-02-23 06:01:29'),
(33, 'Car Engine Maintenance Service', '<p class=\"MsoNormal\"><strong style=\"mso-bidi-font-weight: normal;\">Service detail</strong></p>\r\n<p class=\"MsoNormal\">We can never be too careful when it comes to the engine of our cars &ndash; the most expensive and complex components often exist within the engine compartment. Every sound, noise, smoke or smell should be treated with high level of urgency. Suki spares aims to ensure optimal performance of your engine with our extensive engine service or overhaul. As the heart of your car &ndash; your engine requires pampering and care.</p>', 12000, NULL, '/tmp/phpz53KLj', '2022-01-25 13:41:22', '2022-01-25 13:41:22'),
(29, 'Car Cleaning & Detailing Service', '<p class=\"MsoNormal\" style=\"text-align: left;\">Vehicular hygiene is as important as the mechanical health of your car. Thorough cleaning of the interior and exterior delivers optimal performance of your car.</p>\r\n<p class=\"MsoNormal\" style=\"text-align: left;\">Dirt and grime can build up under a vehicle over time from the road and they are not good for the undercarriage of your vehicle.The vehicle undercarriage has a drain hole which can get clogged and cause the vehicle to malfunction.</p>\r\n<p class=\"MsoNormal\" style=\"text-align: left;\">Rust leads to a faster deterioration of the vehicle condition, and severely affects the chassis of the car. If dirt and other particles accumulated around the engine find a way into the engine this could lead to engine seizure and would require an overhaul.</p>', 12000, NULL, '/tmp/phpxDF6Uv', '2022-01-25 13:21:22', '2022-01-25 13:21:22'),
(28, 'Car AC Service', '<p class=\"MsoNormal\">It&rsquo;s almost cruel to even think of driving your car without an air conditioner. With the wear and tear that your car goes through every day, it is common to see problems in the air conditioner. AC system problems can be resolved easily by if detected early, the key is to be observant and visit the nearest Suki spares workshop for a diagnosis and maintenance</p>\r\n<p class=\"MsoNormal\"><strong style=\"mso-bidi-font-weight: normal;\">Our process</strong></p>\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"text-indent: -18pt; line-height: normal; padding-left: 80px;\"><!-- [if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]-->AC Inspection</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -18pt; line-height: normal; padding-left: 80px;\"><!-- [if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]-->AC Gas top up</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -18pt; line-height: normal; padding-left: 80px;\"><!-- [if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]-->AC Filter Cleaning</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -18pt; line-height: normal; padding-left: 80px;\"><!-- [if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]-->Condenser Cleaning</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -18pt; line-height: normal; padding-left: 80px;\"><!-- [if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]-->AC Vent Cleaning</p>\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"text-indent: -18pt; line-height: normal; padding-left: 80px;\"><!-- [if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]-->AC Leak test</p>', 12000, NULL, '/tmp/phpn4NtKp', '2022-01-25 13:16:53', '2022-01-25 13:16:53'),
(26, 'Car Battery Service', '<p class=\"MsoNormal\">Is your vehicle sluggish cranking and not starting? Have you started noticing that your vehicle&rsquo;s engine cranks is slow or sluggish when you start the car Are the car headlights dimmer than usual ? Have you noticed any corrosion on the battery terminals ? Have you noticed snags with the vehicle electronics ?All the above problems could be battery related. Visit your nearest Autochek workshop for a battery diagnostic. Autochek batteries are 100% genuine and are backed with manufacturer\'s warranty</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>', 12000, NULL, '/tmp/phpubO2dG', '2022-01-25 12:54:37', '2022-01-25 12:54:37'),
(25, 'Car Engine Maintenance Service', '<p class=\"MsoNormal\">Service detail</p>\r\n<p class=\"MsoNormal\">We can never be too careful when it comes to the engine of our cars &ndash; the most expensive and complex components often exist within the engine compartment. Every sound, noise, smoke or smell should be treated with high level of urgency. Suki aims to ensure optimal performance of your engine with our extensive engine service or overhaul. As the heart of your car &ndash; your engine requires pampering and care.</p>\r\n<p class=\"MsoNormal\"><strong style=\"mso-bidi-font-weight: normal;\">Our process</strong></p>\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"text-indent: -18pt; padding-left: 80px;\"><!-- [if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]-->Engine oil viscosity check</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -18pt; padding-left: 80px;\"><!-- [if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]-->Electronics software check</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -18pt; padding-left: 80px;\"><!-- [if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]-->Injection system check</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -18pt; padding-left: 80px;\"><!-- [if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]-->Air filter check</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -18pt; padding-left: 80px;\"><!-- [if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]-->Coil check</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -18pt; padding-left: 80px;\"><!-- [if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]-->Leakage check</p>\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"text-indent: -18pt; padding-left: 80px;\"><!-- [if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]-->Compression check</p>\r\n<p class=\"MsoNormal\"><strong style=\"mso-bidi-font-weight: normal;\">Our assurance</strong></p>\r\n<p class=\"MsoNormal\">At Suki, we keep track of all aspects of your engine to ensure that your car remains in optimal performance shape and avoid unnecessary disappointments.</p>', 12000, NULL, '/tmp/phpzj7L4b', '2022-01-25 04:43:57', '2022-01-25 04:43:57'),
(27, 'TCar Tyre Service', '<p class=\"MsoNormal\" style=\"line-height: normal;\">Cars need regular maintenance in order to perform efficiently, safely while driving, car tires are one of the most important components that has to be regularly checked and maintained, to ignore this component could impact a lot in the car performance and the most significant is the safety of the family in the car while on the road.</p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\">Suki spares workshop offer the following service:</p>\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"text-indent: -18pt; line-height: normal; text-align: left; padding-left: 80px;\"><!-- [if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]-->Tyre Replacement</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -18pt; line-height: normal; text-align: left; padding-left: 80px;\"><!-- [if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]-->Tyre Inspection for tread</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -18pt; line-height: normal; text-align: left; padding-left: 80px;\"><!-- [if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]-->Wheel Rotation</p>\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"text-indent: -18pt; line-height: normal; text-align: left; padding-left: 80px;\"><!-- [if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]-->Wheel Alignment &amp; Balancing</p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\">We offer a range of tyres for your car which are 100% genuine and backed by manufacturer warranty. Book an appointment today.</p>', 12000, NULL, '/tmp/phpPSvDjK', '2022-01-25 13:06:59', '2022-01-25 13:06:59');
